function Product(props) {
  return (
    <li>
      <h2>{props.title}</h2>
      <h3>{props.description}</h3>
      <span>{props.price}</span>
      <span>{props.discount}</span>
      <img src={props.thumnail} alt="thumbnail"/>
      <img src={props.images} alt="Images"/>
    </li>
  );
}

export default Product;
